import React from 'react';
import './Home.css'; // Importa os estilos para o componente Home
import startImage from '../images/pngwing.com.png';
import { useNavigation } from '@react-navigation/native'; // Importa useNavigation
// const history = useHistory();

const Home = () => {
  const navigation = useNavigation(); // Inicializa useNavigation

  const handleStartClick = () => {
    navigation.navigate('Questions'); // Navega para a tela 'Questions'
  };

  return (
    <div className="home-container">
      <h1>Tecido Osseo</h1>
      <img
        src={startImage}
        alt="Imagem Iniciar"
        onClick={handleStartClick} // Altera para handleStartClick
      />
      <p>Iniciar</p>
    </div>
  );
};

export default Home;
